import{_ as i,c as a,o as e,ae as o}from"./chunks/framework.COrXKI8X.js";const t="/searobot-docs/images/media/image1.png",r="/searobot-docs/images/media/image2.png",s="/searobot-docs/images/media/image3.png",n="/searobot-docs/images/media/image4.png",u="/searobot-docs/images/media/image5.png",g=JSON.parse('{"title":"APP 使用指南","description":"","frontmatter":{},"headers":[],"relativePath":"app/guide.md","filePath":"app/guide.md"}'),d={name:"app/guide.md"};function h(c,l,p,m,b,P){return e(),a("div",null,l[0]||(l[0]=[o('<h1 id="app-使用指南" tabindex="-1">APP 使用指南 <a class="header-anchor" href="#app-使用指南" aria-label="Permalink to &quot;APP 使用指南&quot;">​</a></h1><h2 id="连接机器人" tabindex="-1">连接机器人 <a class="header-anchor" href="#连接机器人" aria-label="Permalink to &quot;连接机器人&quot;">​</a></h2><h3 id="通过内网连接" tabindex="-1">通过内网连接 <a class="header-anchor" href="#通过内网连接" aria-label="Permalink to &quot;通过内网连接&quot;">​</a></h3><h4 id="方法一-使用默认配置" tabindex="-1">方法一：使用默认配置 <a class="header-anchor" href="#方法一-使用默认配置" aria-label="Permalink to &quot;方法一：使用默认配置&quot;">​</a></h4><ol><li><p>通过手机或平板连接机器人无线WIFI</p><ul><li>WIFI密码：12345678 <img src="'+t+'" alt="WIFI连接"></li></ul></li><li><p>连接WIFI后，打开机器人操作平台APP <img src="'+r+'" alt="打开APP"></p></li><li><p>在登录界面的选择机器人名称栏，选择&quot;本地连接&quot;选项</p><ul><li>每次退出到登录界面时，都会默认选择&quot;本地连接&quot;选项</li></ul></li></ol><h4 id="方法二-使用自定义配置" tabindex="-1">方法二：使用自定义配置 <a class="header-anchor" href="#方法二-使用自定义配置" aria-label="Permalink to &quot;方法二：使用自定义配置&quot;">​</a></h4><ol><li><p>连接机器人WIFI（密码：12345678）</p></li><li><p>打开APP后，进行机器人配置：</p><ol><li><p>点击【机器人配置】，进入设备配置界面 <img src="'+s+'" alt="设备配置"></p></li><li><p>点击【添加】按钮，输入以下信息：</p><ul><li>机器人名称</li><li>IP地址</li><li>端口 <img src="'+n+'" alt="添加设备"></li></ul></li><li><p>点击【返回】退出设备配置界面</p></li></ol></li><li><p>登录系统</p><ul><li>选择添加的机器名称</li><li>用户名：admin</li><li>密码：123456 <img src="'+u+'" alt="APP首页"></li></ul></li></ol><div class="warning custom-block"><p class="custom-block-title">连接故障处理</p><p>如果连接WIFI后APP无法连接登录控制器，可以尝试修改WIFI连接方式为静态连接/手动设置：</p><ul><li>IP地址：192.168.1.210（建议使用200-255之间的值，防止地址冲突）</li><li>子网掩码：255.255.255.0</li><li>路由器：192.168.1.1</li><li>DNS：8.8.8.8</li></ul></div><h2 id="主要功能操作" tabindex="-1">主要功能操作 <a class="header-anchor" href="#主要功能操作" aria-label="Permalink to &quot;主要功能操作&quot;">​</a></h2><h3 id="地图管理" tabindex="-1">地图管理 <a class="header-anchor" href="#地图管理" aria-label="Permalink to &quot;地图管理&quot;">​</a></h3><h4 id="建图操作" tabindex="-1">建图操作 <a class="header-anchor" href="#建图操作" aria-label="Permalink to &quot;建图操作&quot;">​</a></h4><ol><li><p>遥控移动</p><ul><li>点击APP首页上方的遥控图标，弹出遥控窗口</li><li>通过右侧的遥控手柄将机器人开到合适的位置</li></ul></li><li><p>开始建图</p><ul><li>点击建图图标按钮</li><li>按照界面提示进行操作</li></ul></li></ol><div class="tip custom-block"><p class="custom-block-title">建图建议</p><ul><li>建图时保持环境稳定，避免人员频繁走动</li><li>建议以适中速度移动机器人</li><li>注意观察地图生成质量</li></ul></div><h3 id="导航功能" tabindex="-1">导航功能 <a class="header-anchor" href="#导航功能" aria-label="Permalink to &quot;导航功能&quot;">​</a></h3><h4 id="位置初始化" tabindex="-1">位置初始化 <a class="header-anchor" href="#位置初始化" aria-label="Permalink to &quot;位置初始化&quot;">​</a></h4><ul><li>用于机器人定位和导航的起点设置</li><li>确保初始位置准确性</li></ul><h4 id="任务管理" tabindex="-1">任务管理 <a class="header-anchor" href="#任务管理" aria-label="Permalink to &quot;任务管理&quot;">​</a></h4><ol><li><p>录点/手绘点</p><ul><li>可以通过录制或手动绘制方式添加导航点</li><li>支持设置点位属性和行为</li></ul></li><li><p>路径规划</p><ul><li>支持录制路径和手绘路径两种方式</li><li>可以设置路径属性和行为</li></ul></li><li><p>任务执行</p><ul><li>支持单次任务和循环任务</li><li>可以设置任务优先级和执行条件</li></ul></li></ol><h3 id="系统设置" tabindex="-1">系统设置 <a class="header-anchor" href="#系统设置" aria-label="Permalink to &quot;系统设置&quot;">​</a></h3><h4 id="参数配置" tabindex="-1">参数配置 <a class="header-anchor" href="#参数配置" aria-label="Permalink to &quot;参数配置&quot;">​</a></h4><ul><li>可以调整机器人运行参数</li><li>支持配置导航参数和任务参数</li></ul><h4 id="系统监控" tabindex="-1">系统监控 <a class="header-anchor" href="#系统监控" aria-label="Permalink to &quot;系统监控&quot;">​</a></h4><ul><li>实时显示机器人状态</li><li>支持查看系统日志和错误信息</li></ul><h2 id="操作流程建议" tabindex="-1">操作流程建议 <a class="header-anchor" href="#操作流程建议" aria-label="Permalink to &quot;操作流程建议&quot;">​</a></h2><ol><li><p><strong>首次使用</strong></p><ol><li>连接机器人WIFI</li><li>配置网络设置</li><li>登录系统</li><li>进行地图建制</li></ol></li><li><p><strong>日常使用</strong></p><ol><li>确认机器人状态</li><li>初始化位置</li><li>选择或创建任务</li><li>开始执行任务</li><li>监控任务执行情况</li></ol></li><li><p><strong>维护管理</strong></p><ul><li>定期检查系统状态</li><li>及时处理异常情况</li><li>定期更新地图数据</li></ul></li></ol><div class="tip custom-block"><p class="custom-block-title">使用建议</p><ol><li>首次使用时，建议详细阅读操作手册</li><li>进行重要操作前，确保机器人电量充足</li><li>定期备份重要的地图和任务数据</li><li>遇到问题时，及时联系技术支持</li></ol></div>',26)]))}const _=i(d,[["render",h]]);export{g as __pageData,_ as default};
